public interface IUserService
{
    /// <summary>
    /// 로그인한 사용자 정보
    /// </summary>
    User UserInfo { get; init; }

    /// <summary>
    /// 사용자 프로필 정보 요청
    /// </summary>
    /// <param name="id"></param>
    /// <returns></returns>
    Task<UserProfile?> GetMyProfileAsync(Guid id);

    /// <summary>
    /// 친구 목록 요청
