    private async Task<User> CreateMockDataByUser(int num)
    {
        return await Task.Run(() =>
        {
            Thread.Sleep(1700);  // 로딩 표시 fake

            UserProfile profile = new UserProfile()
            {
                UserProfileImgBase64 = "",
                Status = $"상태메세지, 친구-{num}"
            };

            User user = new User()
            {
                Id = Guid.NewGuid(),
                FriendUserType = Common.Enums.EFriendUserType.Friend,
                Name = $"친구-{num}",
                PhoneNumber = num.ToString(),
                Nationality = "KR",
                Email = $"friend_{num}@wpfkakao.com",
                NickName = $"arooong_친구{num}",
                UserProfile = profile
            };

            return user;
        });
    }

    private async Task<ChattingRoom> CreateMockDataByChattingRoom(int num)
    {
        return await Task.Run(() =>
        {
            ChattingRoom chattingRoom = new ChattingRoom()
            {
                Id = Guid.NewGuid(),
                // 1:1 채팅 - 0 index : 자기 자신, 1 index : 상대방 유저 정보
                user = new List<User>() { new User() { Name = "arooong"}, new User() { Name = $"친구{num}" } },
                ThumbnailBase64 = "",
                LastChatMsg = "마지막 채팅 내용!!~~#@",
                ChatCount = num + 1,
                IsNotification = true,
                ChattingType = Common.Enums.EChattingRoomType.PersonalChat,
                LastChatTime = DateTime.Now
            };

            return chattingRoom;
        });
    }
